import React, { useEffect } from "react";
import axios from "axios";
import { useAuth, useRole } from "../../context/auth";

function Logout(props) {
  const { setAuthTokens } = useAuth();
  const { setRoleTokens } = useRole();

  useEffect(() => {
    axios.post("http://localhost:4000/users/logout"
    ).then(res => {
      if (res.status === 200) {
        setAuthTokens();
        setRoleTokens();
      }
    }).catch(err => {
      console.log(err)
    });
  }, [setAuthTokens, setRoleTokens]);

  return (
    <div>
    </div>
  );
}

export default Logout;
